origin_prompt.content:
你是一个可以使用外部工具的助手。你可以调用以下的工具:
[
    {
        "name": "HealthInsurance.provide_recommendation",
        "description": "根据提供的保险计划类型，生成个性化的保险推荐。",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "用户选择的保险计划类型。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "recommendation",
                "description": "生成的个性化保险推荐。"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_network_doctors",
        "description": "获取指定保险计划类型下的网络医生列表。",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "用户选择的保险计划类型。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "doctor_count",
                "description": "网络医生列表中的医生数量。"
            }
        ]
    },
    {
        "name": "HealthInsurance.compare_doctor_quality",
        "description": "比较两种不同保险计划类型下的医生质量。",
        "required_parameters": [
            {
                "name": "plan_type_1",
                "type": "STRING",
                "description": "第一种保险计划类型。"
            },
            {
                "name": "plan_type_2",
                "type": "STRING",
                "description": "第二种保险计划类型。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "comparison_result",
                "description": "两种保险计划类型下医生质量的比较结果。"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_coverage_details",
        "description": "获取指定保险计划类型的覆盖范围详细信息。",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "用户选择的保险计划类型。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "coverage_details",
                "description": "保险计划的覆盖范围详细信息。"
            }
        ]
    },
    {
        "name": "HealthInsurance.calculate_premium",
        "description": "根据用户输入的保险计划类型和个人信息，计算保险费用。",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "用户选择的保险计划类型。"
            },
            {
                "name": "age",
                "type": "INTEGER",
                "description": "用户的年龄。"
            },
            {
                "name": "gender",
                "type": "STRING",
                "description": "用户的性别。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "premium_amount",
                "description": "计算出的保险费用。"
            }
        ]
    },
    {
        "name": "HealthInsurance.check_eligibility",
        "description": "检查用户是否符合指定保险计划类型的资格要求。",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "用户选择的保险计划类型。"
            },
            {
                "name": "age",
                "type": "INTEGER",
                "description": "用户的年龄。"
            },
            {
                "name": "employment_status",
                "type": "STRING",
                "description": "用户的就业状态。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "eligibility_status",
                "description": "用户是否符合资格要求的状态。"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_claim_history",
        "description": "获取用户在指定保险计划类型下的理赔历史记录。",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "用户选择的保险计划类型。"
            },
            {
                "name": "user_id",
                "type": "STRING",
                "description": "用户的唯一标识符。"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "claim_history",
                "description": "用户的理赔历史记录。"
            }
        ]
    }
]
如果你已经知道答案，请调用FinishAction来提供最终的回复。
